import React, { useState } from 'react';
import './styles.css';
import magnusImage from './assets/magnus.jpg';
import kingBlack from './assets/king-black.svg';
import queenBlack from './assets/queen-black.svg';
import rookBlack from './assets/rook-black.svg';
import bishopBlack from './assets/bishop-black.svg';
import knightBlack from './assets/knight-black.svg';
import pawnBlack from './assets/pawn-black.svg';
import kingWhite from './assets/king-white.svg';
import queenWhite from './assets/queen-white.svg';
import rookWhite from './assets/rook-white.svg';
import bishopWhite from './assets/bishop-white.svg';
import knightWhite from './assets/knight-white.svg';
import pawnWhite from './assets/pawn-white.svg';

const AboutMagnus = () => {
  const [selectedSection, setSelectedSection] = useState(null);

  const handleSectionClick = (section) => {
    setSelectedSection(selectedSection === section ? null : section);
  };

  const sections = {
    bio: "Magnus Carlsen, born November 30, 1990, is a Norwegian chess grandmaster who is the current World Chess Champion...",
    accomplishments: "World Chess Champion (2013–present), Four-time World Rapid Chess Champion...",
    skills: {
      positionalPlay: "Carlsen's positional play is often compared to that of chess legends like Anatoly Karpov...",
      endgameMastery: "Carlsen's endgame skills are considered some of the best in the history of chess...",
      versatility: "Magnus is known for his versatility and deep opening preparation..."
    }
  };

  return (
    <div className="about-magnus">
      <div className="background-image">
        <img src={magnusImage} alt="Magnus Carlsen" className="magnus-image" />
      </div>
      <header>
        <h1>Magnus Carlsen</h1>
        <p>The Chess Maestro</p>
      </header>
      <div className="floating-pieces">
        <img src={kingBlack} className="chess-piece king-black" alt="king-black" />
        <img src={queenBlack} className="chess-piece queen-black" alt="queen-black" />
        <img src={rookBlack} className="chess-piece rook-black" alt="rook-black" />
        <img src={bishopBlack} className="chess-piece bishop-black" alt="bishop-black" />
        <img src={knightBlack} className="chess-piece knight-black" alt="knight-black" />
        <img src={pawnBlack} className="chess-piece pawn-black" alt="pawn-black" />
        <img src={kingWhite} className="chess-piece king-white" alt="king-white" />
        <img src={queenWhite} className="chess-piece queen-white" alt="queen-white" />
        <img src={rookWhite} className="chess-piece rook-white" alt="rook-white" />
        <img src={bishopWhite} className="chess-piece bishop-white" alt="bishop-white" />
        <img src={knightWhite} className="chess-piece knight-white" alt="knight-white" />
        <img src={pawnWhite} className="chess-piece pawn-white" alt="pawn-white" />

        <div className="hidden-section bio" onClick={() => handleSectionClick('bio')}>
          <span>Biography</span>
        </div>
        <div className="hidden-section accomplishments" onClick={() => handleSectionClick('accomplishments')}>
          <span>Accomplishments</span>
        </div>
        <div className="hidden-section skills" onClick={() => handleSectionClick('skills')}>
          <span>Skills</span>
        </div>
      </div>

      {selectedSection && (
        <div className={`section-content ${selectedSection}`}>
          {selectedSection === 'bio' && <p>{sections.bio}</p>}
          {selectedSection === 'accomplishments' && (
            <ul>{sections.accomplishments.split(', ').map(acc => <li key={acc}>{acc}</li>)}</ul>
          )}
          {selectedSection === 'skills' && (
            <div>
              <h3>Positional Play</h3>
              <p>{sections.skills.positionalPlay}</p>
              <h3>Endgame Mastery</h3>
              <p>{sections.skills.endgameMastery}</p>
              <h3>Versatility</h3>
              <p>{sections.skills.versatility}</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default AboutMagnus;
